import React from 'react';
import logo from './logo.svg';
import Webcam from "react-webcam";
import './App.css';


function PictureCapture() {
    return (
        <React.Fragment>
            <Webcam/>
            <button type="button">Take Picture!</button>
        </React.Fragment>
    );
}

export default PictureCapture;
